import React from 'react';

function Home() {
  return (
    <div className="Home">
        <p className="homeParagraph">Welcome to my portfolio! This page exists to showcase my past, current, and future projects. I'm a software developer who lives in the St. Louis, MO area. I have experience with modern web technologies such as HTML/CSS/JS, Angular, mySQL, as well as application programming languages such as Java and C++. I'm currently learning React which is what this page was made with. Feel free to contact me with any questions you have!</p>
    </div>
  );
}

export default Home;
